  `create_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建日期',
  `modify_date` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改日期',
  `dead_share_date` datetime DEFAULT NULL COMMENT '截止分享日期',
  `consumer_id` varchar(40) NOT NULL COMMENT '所属用户',
  PRIMARY KEY (`id`),
  KEY `t_flowcharts_t_users_id_fk` (`consumer_id`),
  CONSTRAINT `t_flowcharts_t_users_id_fk` FOREIGN KEY (`consumer_id`) REFERENCES `t_consumers` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
