INSERT INTO `bleuon`.`t_articles` (`id`,`title`,`title_tag`,`digg`,`bury`,`views`,`desc`,`desc_tag`,`desc_imgs`,`type`,`ranking_type`,`content`,`consumer_id`,`create_date`,`modify_date`) VALUES ('1c7ead63-6a30-433e-9538-c85af4a544f8', '从草稿级到演示级，模板整容只需用这4个方法！', '[\"涨知识\",\"图文教程\"]', 1, 0, 12, '作图过程中不断调整图形的位置、大小，简直就是一场“我与我的战争”，其实画图过程中不需要频繁进行对齐操作，后续很有可能还会改不说，思路被打断才是最难受的。', '[\"关系图\"]', '[]', '分享', NULL, '<p>常年混迹于用户群的小编发现，很多用户作图不仅仅是自己使用，还会用于和同事分享、向领导汇报、面向全团队阐述自己的思路等等。<br>其实在实际工作中，小编就经常拿做好的图当PPT。日常开会时，一张图摆出来，突显专业的同时又不会太过花哨，看似简简单单，背后的缜密思考却展露无遗，简直就是现代职场人士的第二张名片！今天小编和大家分享几个流程图画布使用中用上就好看的小方法，让你的图立马“穿上一身帅气西装”，专业度更上一层楼！</p><p>作图过程中不断调整图形的位置、大小，简直就是一场“我与我的战争”，其实画图过程中不需要频繁进行对齐操作，后续很有可能还会改不说，思路被打断才是最难受的。</p>', 'f7405813-5579-4ea6-b0e2-7ad370da386d', '2023-10-31 01:51:40', '2024-04-10 01:32:23'),('8426e721-13aa-489e-8c76-958b1c9a0bae', '如何做好项目管理？', '[\"涨知识\"]', 2, 1, 17, '日常工作中，我们会遇到各种大大小小的工作项目，如何能让项目保质保量的完成，就需要项目管理。项目管理是什么？一句话解释：在有限的时间内，在约束的范围中，集合有限资源来完成项目目标。', '[\"读书分享\"]', '[\"http://localhost:8080/api/public/file/preview/image?filepath=D:/Development/bleuon-app/statics/static/images/article/desc&filename=640 (3)_1ca0a5ac-e104-4650-b4d3-c5e259f4c896.png\"]', '分享', NULL, '<p>日常工作中，我们会遇到各种大大小小的工作项目，如何能让项目保质保量的完成，就需要项目管理。项目管理是什么？一句话解释：在有限的时间内，在约束的范围中，集合有限资源来完成项目目标。</p><p>本周小编通过11张图项目管理的思维导图和流程图，为大家分享项目管理的内容主要有哪些，如何做好项目管理中的每一个环节，让工作有条不紊的按照预期完成。</p><p>在项目管理中，流程一般概括为10大知识领域、5大项目管理过程组、49个过程矩阵，只要对这些环节牢牢把关，按计划完成， 项目就能顺利推进和完成，接下来通过一张图来呈现它们之间的关系。</p><figure class=\"image\"><img style=\"aspect-ratio:1009/1402;\" src=\"http://localhost:8080/api/public/file/preview/image?filepath=D:/Development/bleuon-app/statics/static/images/article/content&filename=640 (1)_b026c20c-ce28-48d4-9be5-c6473c4a160d.webp\" width=\"1009\" height=\"1402\"></figure><p>项目管理的内容包含10个部分，分别是：整体管理、范围管理、时间管理、成本管理、质量管理、人力资源管理、沟通管理、风险管理、采购管理、集成管理，接下来结合思维导图和流程图对这10个知识领域展开说明。</p><p><strong>1、项目整体管理</strong></p><p>整体管理是指识别、定义、结合、统一与协调项目管理过程组中的各个过程以及项目管理活动，用一句话来总结项目整合管理，其作用犹如项链中的那根线，将项目管理过程组中需要的各个过程进行有效综合。</p><p>整理管理的主要内容是制定项目章程、制定项目管理计划、指导和管理项目工作、监督项目工作等。</p><p><strong>2、项目范围管理</strong></p><p>项目范围管理是指确保项目包括成功完成项目所需的功全部工作，但又只包括必须完成的工作的各个过程，一句话概括为：做且只做该做的事，不该做的不做。</p><p><strong>3、项目时间管理</strong></p><p>项目时间管理是指让一切按照既定的进度进行，对项目进行合理的时间管理，才是保证项目顺利交付的关键，那么如何才能做好项目时间管理呢？可以从六个方面入手：定义项目范围，注重分解工作；对项目工作进行优先排序；项目工期估算；制定项目进度表；进行进度控制；工具使用等。</p><p><strong>4、项目成本管理</strong></p><p>成本管理是指尽量让项目实际进行中的成本控制在预算范围之内，确保在预算之内完成项目，主要包括规划成本管理、估算成本、制定预算和控制成本四个过程。</p><p>项目成本管理其实就是项目“节流”的过程，一般是对项目的资源和费用进行估算、控制和管理.两个方面需要注意：一是在项目运行前要做好预算计划；二是实际花费要有真实、实时的数据反馈。项目管理人员只有对这两种数据进行分析管理，项目成本管理才会更加科学和合理，但有一个误区大家不要踩坑，项目成本管理≠越省钱越好。</p><p><strong>5、项目质量管理</strong></p><p>项目质量管理主要包含了规划质量管理、管理质量、控制质量三个过程，目的是做出合格的质量、建立信心(客户/团队)、满足特定的需求和期望、审计质量要求和质量控制测量结果和改进生产过程。</p><p><strong>6、项目人力资源管理</strong></p><p>人才是企业最重要的财富，项目人力资源管理是项目管理的一个重要组成部分。项目人力资源管理的四个过程：制定人力资源计划、组建项目团队、建设项目团队和管理项目团队。</p><p>这个过程看起来比较容易，其实管理人才是最难的，总之项目经理必须做到对人要体谅和尊敬、明白什么能激励人、与人仔细沟通，只有集中精力做好人力资源管理才能使下属很好的完成任务。</p><p><strong>7、项目沟通管理</strong></p><p>沟通管理就是在合适的时间让合适的人通过合适的方式把合适的信息传达给合适的人，看似一句无用的话，但如何选择“合适”的人、“合适”的方式非常考验人，所以沟通管理能力是项目经理最重要的能力之一。</p>', 'ea209fbb-8f0e-483e-be86-c3629ecbe6d1', '2023-10-20 21:02:43', '2024-04-08 23:48:59'),('f4faa0ad-1740-47e2-bd68-42c0aff72649', '自我觉醒宝藏书单 | 提升认知水平，摆脱内耗', '[\"涨知识\"]', 0, 0, 3, '自我觉醒宝藏书单 | 提升认知水平，摆脱内耗。接下来，为大家推荐6本能提升你认知的书，静下心读完，你一定会有收获。', '[\"关系图\"]', '[]', '分享', NULL, '<p>今年身边的朋友都在抱怨工作越来越难做了，钱越来越难挣了！以前靠着不断努力也能生活的不错，以后只靠努力怕是只能解决温饱了。正如大前研一在《思考的技术》中所说：“思考力差距化的时代已经到来了，而由思考力的差距所造成的经济能力差距也是呈倍数级放大的”，也就是说，未来的竞争将是认知层面的竞争。</p><p>俞敏洪也在强调认知的重要性：“人一辈子最大的差距是认知上的差距，认知是什么？认知就是对于一件事情的看法。当我们的认知水平提高以后，你就像是站在宇宙看地球，站在高山看大海，拥有了多角度全局分析问题、解决问题的能力。那些斤斤计较、目光短浅、执着于自己偏执理念不愿意自拔的人，常常就是因为认知能力水平不够导致的。”</p><p>那么，如何提升自己的认知呢？我觉得读书是最经济、最简单、最适合普通人的方法，因为每一本书都是前辈们智慧与思考的结晶，你读的书越多，理解的东西就越多。</p><p>接下来，为大家推荐6本能提升你认知的书，静下心读完，你一定会有收获。</p><h1><strong>01《人类简史》</strong></h1><p>你有没有好奇过为什么人类会走到今天这一步？每一个文明的兴衰，每一次重大的历史事件，都是人类文明发展史上的重要一笔。《人类简史》是一本关于人类历史的宏伟叙事，让我们深入探索人类从出现智人开始的漫长历史，以及历史中那些影响深远的因素。</p><p>阅读完这本书，感受到了人类历史的宏伟和久远，更加深刻地理解了人类文明的演化过程，对未来也有了更多的思考和展望。如果你也想要了解人类历史的奥秘，不妨一读。</p><h1><strong>02《纳瓦尔宝典》</strong></h1><p>作者的观点让我惊叹，一口气看完它有种“怎么我现在才读到”的遗憾。</p><p>这本书收集整理了硅谷知名天使投资人纳瓦尔的智慧箴言录，尤其是关于财富积累和幸福人生的原则与方法。</p><p>他说：不要无意识地给自己太多欲望，不要让欲望来得那么随意，只选择专注一个你最无法抵挡的欲望，为这个欲望受苦也没关系，但对于其他的欲望，你需要学会放手，然后你才会获得内心的平静、平和和轻松，接着你才会把事情做得更好。大多数人不开心的时候，比如抑郁，他们缺的就是一个清晰冷静的头脑。</p><p>关于如何赚钱、如何让自己不可替代、如何增强判断力、如何获取幸福、自我救赎、选择伴侣等，每一个话题都在我们生活中遇到，而纳瓦尔的解答让我醍醐灌顶。</p><h1><strong>03《娱乐至死》</strong></h1><p>“我们将毁于我们热爱的东西。”看完这本书，一下子被震撼到了！作者早在40年前就预言了\"人们会由于享乐而失去自由\"！</p><p>想想晚上总是控制不住地熬夜刷手机看剧，困成狗还停不下来，朝着“娱乐至死”的方向越走越远......细思及恐！我们都被“娱乐”奴役了！</p><p>“奶头乐理论”想必大家都听过，它最早出现于《全球化陷阱》一书，指的是世界上的20%的精英为安抚其他80%的平民，避免阶级冲突，让企业制造让人沉迷的产品，比如八卦娱乐新闻、短视频、网络游戏等，让他们沉浸在低级快乐中渐渐丧失思考能力、消磨意志而不自知。</p><p>所以读书的好处就是让我们跳出混沌和陷阱，保持清醒和思考。</p><h1><strong>04《底层逻辑》</strong></h1><p>成功的人为什么可以实现梦想？因为他们懂规律，洞悉底层逻辑。什么是底层逻辑？它指从事物的底层、本质出发，是万千“术”后的“道”，是万千现象背后的底层规律。底层逻辑越坚固，解决问题的能力就越强。</p><p>巴菲特说：要想彻底了解这个世界，有一个好办法就是先把本领域的事情研究透，挖出其中的底层逻辑，只要你能做到这一步，就很容易搞定其它领域的事。</p><p>刘润一直是我特别佩服的商业顾问老师，他的公众号文章经常能带给我很多启发，年底的演讲我也都会看，并且反复研读，像海绵一样尽力吸收他传递的知识。</p><p>这本《底层逻辑》详细分析了是非对错、思考问题、个体进化、理解他人和社会协作5个方面的底层逻辑，很深刻地影响力我的认知和处事方式。</p><h1><strong>05《认知觉醒》</strong></h1><p>这是一本讲解个人成长方法论的一本书，它深刻剖析了大脑、潜意识、元认知的概念，以及如何提高专注力、学习力、行动力和情绪力等，让你高速成长。</p><p>作者说，成功的人生就是要消除人生中的模糊，让目标清晰、知识清晰、情绪清晰。人们总习惯在模糊区打转，在舒适区兜圈，重复做已经掌握的事情，对真正的困难视而不见。深有感触！</p><p>同时，它还像一面镜子一样无情戳穿我的问题，比如它说：你焦虑的原因是想同时做很多事，又想立即看到效果。</p><h1><strong>06《人生十二法则》</strong></h1><p>总是为未来焦虑怎么办？想躺平又不甘心怎么办？同事们都在卷我怎么办？......答案都在今天为你种草的这本《人生十二法则》中！</p><p>龙虾教授通过“12个法则”来解答生活中遇到的大多问题，无论是混沌度日还是积极生活，时间的指针依旧飞速转动，永不停歇。</p><p>这本书真的是干货满满！作者乔丹·彼得森用简洁而有说服力的方式，让我们看到把人生化繁为简的可能。通过他的法则，我们可以让不确定的人生获得某种确定性的倚靠。</p><p>以上就是今天分享的6本提升认知能力的书，看过这几本或者其他书的小伙伴，留言告诉我，哪本书让你开始血脉觉醒了呢？</p>', 'ea209fbb-8f0e-483e-be86-c3629ecbe6d1', '2023-10-20 20:48:57', '2024-04-08 22:48:03')
;
